import React from 'react';
import { NavLink } from "react-router-dom";
import './Style.css';
const Card = (props) => {
    return (
        <>
           <div className='Cardcmp'>
                    <div className='image'>
                    <img src={props.src} alt='image'/>
                    </div>
        <div className='details'>
               <h2>{props.title}</h2>
               <p>{props.details}</p>
               </div>
              <NavLink>
               <button> Link</button>
               </NavLink>
           </div>

            
            

        </>
    );
}

export default Card;
